import { Modal, Button, Select, Row, Col } from "antd";
import { connect } from "react-redux";

const Onboarding = (props) => {
  return (
    <div>
      <Modal visible={props.fbId} centered footer={null}>
        <div className="modal-inner">
        <div className="fb"><img src="/images/facebook.svg"/></div>
          <h3>Lets search Facebook</h3>
          <p>Coonect to Facebook to begin searching for interest</p>
          <Button type="primary">Connect Facebook</Button>
        </div>
      </Modal>
      <style jsx>{`
        .modal-inner {
          display: flex;
          flex-direction: column;
          justify-content: center;
          align-items: center;
        }

        .fb{
            width: 50px;
        }

        .fb img {
            width: 100%;
        }
      `}</style>
    </div>
  );
};

const mapStateToProps = (state) => ({
  fbId: state.user.fbToken.fbId,
});

export default connect(mapStateToProps)(Onboarding);
